import React from 'react'
import History from './../../components/History'
import Calculator from '../../components/Calculator'

const Landing = (props) => {
  return (
    <div style={{ width: 300, display: 'flex', flexDirection: 'column' }}>
      <Calculator />
      <History />
    </div>
  )
}

export default Landing
